import React, { ReactElement } from "react";
import { IRootObject } from './interfaces';

interface StockResultProps {
    response: JSON | string
}

function StockResultDisplay(props: React.PropsWithChildren<StockResultProps>):ReactElement {
    console.log(`in the display comp it is ${props.response}`)
    console.log(`type is ${typeof props.response}`)


    function stringToObject(props: StockResultProps) {
        if (typeof props.response != 'string') {
            const response = props.response as unknown as IRootObject
            return response
        }
    }
    const obj: IRootObject | null = stringToObject(props) ?? null
    if (obj) {
        return (
            <table>
                <thead>
                    <td>{obj.companyName}: ${obj.symbol}</td>
                </thead>
            <tbody>
                <tr><td>Latest Price:</td><td> {obj.latestPrice}</td></tr>
                <tr><td>52 Week High:</td><td> {obj.week52High}</td></tr>
                <tr><td>52 Week Low:</td><td> {obj.week52Low}</td></tr>
                <tr><td>P/E Ratio:</td><td> {obj.peRatio}</td></tr>
                <tr><td>Market Cap:</td><td> {obj.marketCap}</td></tr>
            </tbody>
        </table>
        )
    } else {
        return (
            <div>
            </div>
        )
    }

    //     return(

    //     )
    // } else {
    //     return <div></div>
    // }
}


export default StockResultDisplay;
